	add("singlestick", "{\"term\":\"singlestick\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|single|stick|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a one-handed wood stick used for fencing in place of a sword.\u0026lt;ref\u0026gt;Allanson-Winn, R. G. et al. (2006). \u0027Broadsword and Singlestick: With Chapters on Quarter-Staff, Bayonet, Cudgel, Shillalah, Walking-Stick, Umbrella, and Other Weapons of Self-Defense\u0027. Paladin Press. ISBN 1581605129\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Thomas A. Green, ‎Joseph R. Svinth, \u0027Martial Arts of the World\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Scottish broadsword training methods included practice with the \u0027\u0027singlestick\u0027\u0027. The singlestick is a wooden rod (usually ash) with a basket hilt. Length was usually 3 feet (just under a meter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a martial art, sport or exercise using a cudgel or backsword\", \"priority\":4}]}, \"synonyms\":{}}");

	add("singlet", "{\"term\":\"singlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vest; a sleeveless garment with a low-cut neck, often worn underneath a shirt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, George Orwell, \u0027Nineteen Eighty-Four\u0027, p28\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Winston wrenched his body out of bed — naked, for a member of the Outer Party received only 3,000 clothing coupons annually, and a suit of pyjamas was 600 — and seized a dingy \u0027\u0027singlet\u0027\u0027 and a pair of shorts that were lying across a chair\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Nicole Matthews, \u0027Kitsch on the Fringe: Suburbia in Recent Australian Comedy Film\u0027, Roger Webster, \u0027Expanding Suburbia: Reviewing Suburban Narratives\u0027, %22singlets%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dVcjM2r42Uj\u0026amp;sig\u003dtGEcjoVrM6_Nd_TQZwPHVfG4y1c\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dU3BMUObeL4mfiQe9poDIAw\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"%22singlets%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 176\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The semiotics of the \u0027\u0027singlet\u0027\u0027 - immediately identifiable in Australia, especially in its usual shade of blue, with male manual labourers\u0026lt;sup\u0026gt;16\u0026lt;/sup\u0026gt; - underlines the contrast between the effete fakery of ballroom costumes and real masculinity to be found underneath or in the world of folk dancing\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Albert Moran, Errol Vieth, \u0027Film in Australia: An Introduction\u0027, %22singlets%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dI_P2vKwF4G\u0026amp;sig\u003dV5U3O3wyPrC7UH9lkHYiTlFl5ZQ\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dU3BMUObeL4mfiQe9poDIAw\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"%22singlets%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 85\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"However, even in the latter he wears a blue \u0027\u0027singlet\u0027\u0027 to help remind the audience of his working-class roots\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Deborah Penrith, \u0027Live \u0026amp; Work in: Australia\u0027, Crimson Publishing, UK, %22singlets%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dquwXfDXyg7\u0026amp;sig\u003dj6YTv8kMn-Z5aWinBAMT1BXfLs4\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dU3BMUObeL4mfiQe9poDIAw\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"%22singlets%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 192\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Women wear dresses, cropped trousers and vests with lightweight linen jackets and you will find men in anything from a business suit to a pair of stubbies (very short shorts) and a \u0027\u0027singlet\u0027\u0027 top (white vest) or knee-length cargo trousers\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A multiplet having a single member, especially a single spectroscopic peak\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A quantum state having zero spin\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Timothy M. Cox, \u002790: Protoporphyria\u0027, Karl M. Kadish, Kevin M. Smith, Roger Guilard, (editors), \u0027The Porphyrin Handbook\u0027, Volume 14: Medical Aspects of Porphyrins, %22singlets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dukxKz71ePt\u0026amp;sig\u003dEUUJK5Ad8WvNnvggQptZfQQvilI\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d1AhMUMr-I--QiQeLyYH4BQ\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"%22singlets%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 132\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"When a ground state molecule absorbs a photon, the values of the electron spins are not altered and thus the \u0027primary\u0027 excited state is the \u0027\u0027singlet\u0027\u0027 state\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Donald L. Pavia, Gary M. Lampman, George S. Kriz, Randall G. Engel, \u0027A Small Scale Approach to Organic Laboratory Techniques\u0027, %22singlets%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dX2y6g6S0ey\u0026amp;sig\u003dk23EKZ_yse9LRTyFse_Iy5wo9eM\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d1AhMUMr-I--QiQeLyYH4BQ\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"%22singlets%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 416\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"However, even if it were possible to supply benzophenone with radiation of the appropriate wavelength to produce the second excited \u0027\u0027singlet\u0027\u0027 state of the molecule, this \u0027\u0027singlet\u0027\u0027 would rapidly convert to the lowest \u0027\u0027singlet\u0027\u0027 state (S1\", \"priority\":20}]}, \"synonyms\":{}}");

	add("singlism", "{\"term\":\"singlism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|single|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Discrimination against and negative perception of single people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Bella DePaulo, \u0027Singled Out: How Singles are Stereotyped, Stigmatized, and Ignored, and Still Live Happily Ever After\u0027, St. Martin\u0027s Press (2006), ISBN 9780312340827, [http://books.google.com/books?id\u003dZrjXIZEq4S0C\u0026amp;pg\u003dPA228 page 228-229\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Singlism\u0027\u0027 seems to seep into way too many of the nooks and crannies of a person\u0027s life and leave its stain. A job applicant shows up for an interview and is asked how he will feel at company social events when he is the only one without a spouse\", \"priority\":3}]}, \"synonyms\":{}}");

	add("singlist", "{\"term\":\"singlist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|single|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who discriminates on the basis of singlehood; one who holds negative views of single people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, w:Kay S. Kay S. Hymowitz, \u0027Manning Up: How the Rise of Women Has Turned Men Into Boys\u0027, Basic Books (2011), ISBN 9780465022359, [http://books.google.com/books?id\u003d_8VoCbJAMpwC\u0026amp;pg\u003dPT99 unnumbered pages\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Like racists and sexists, \u0027\u0027singlists\u0027\u0027 discriminate against an outcast group\", \"priority\":3}]}, \"synonyms\":{}}");

