	add("sinker", "{\"term\":\"sinker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|sink}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A weight used in fishing to cause the line or net to sin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Hook the \u0027\u0027sinker\u0027\u0027 onto this loop\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of several high speed pitches that have a downward motion near the plate; a two-seam fastball, a split-finger fastball, or a forkbal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027sinkers\u0027\u0027 drew one ground ball after another\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"sinker Sinker nail, used for framing in current construction\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A doughnut; a biscuit\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1926\u0027\u0027, Edna Ferber, \u0027Show Boat: A Novel\u0027, page 26\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Of the fifty cents, ten went for the glassy shoeshine; twenty-five for a boutonniere; ten for coffee and \u0027\u0027sinkers\u0027\u0027 at the Cockeyed Bakery\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Gerald J. Prokopowicz, \u0027All for the Regiment: The Army of the Ohio, 1861-1862\u0027, page 14\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"they improvised by opening a barrel of flour and letting each man dump in a quart of water (if he had one) and scoop out a handful of dough to bake into rock-hard \u0027\u0027sinkers\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, William W. Johnstone, \u0027Ambush Of The Mountain Man\u0027, page 16\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"quot;Gonna have to dip them \u0027\u0027sinkers\u0027\u0027 in coffee to get \u0027em soft enough to chew,\u0026quot; Jason Biggs said, grinning\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"In knitting machines, one of the thin plates, blades, or other devices, that depress the loops upon or between the needles\", \"priority\":13}]}, \"synonyms\":{}}");

